import React from 'react'
import './blog.css'
const Blog = () => {
  return (
    <div className='gpt3__blog section__padding'>
      <div className='gpt3__blog-heading'>
        <h1 className='gradient__text'>Alot is hapenning, We are blogginf about it.</h1>
      </div>
    </div>
  )
}

export default Blog
